Let's make the best of this "stay at home" order and challenge ourselves with baking something that we always wanted to try or something we have been intimidated by. for me it's was decorating cookies with Royal Icing. .
.
I challenged myself, I loved it! I purchased a kit from @cakewalksupplies in Anaheim the staff there is amazing! .
.
I'm challenging you and some of my baking/cooking friends please tag me and  #rgcbakingchallenge so I can report it in my stories! .
.
